offers.description:
Продаю машину, которая служит мне верой и правдой уже 4 год.  После рождения ребенка стало неудобно пользоваться трёхдверным авто, поэтому готов продать или поменяться на машину четырёхдверную в таком же отличном состоянии как и мой  Ford.  Машина в отличном техническом и внешнем состояние. В большей части времени машина находится в гараже, так как работаю вахтой. За три с небольшим года мною были сделаны следующие работы:
- капитальный ремонт рулевой рейки;
- замена термостата;
- замена передних и задних ступенчных подшипником;
- полная замена всех резинок передней и задней подвески;
- заменены тормозные колодки;
- 15т км назад был заменён ремень ГРМ со всеми роликами и помпой;
- замена моторчика стеклоочистителя;
- ремонт генератора и стартера;
- замена ремня генератора;
- 20т км назад менял антифриз с маслом в  коробке;
- на прошлой неделе поменял масло в двигателе и фильтра;
- каждый сезон меняю свечи с салонным и воздушным фильтром.
Авто по городу ест всего 8 литров, что понравится, тем кто любит экономию😉
Машину всегда поддерживал в отличном состоянии, потому что не планировал от нее избавиться.
В подарок отдам практически новую зимнюю резину.
